import logo from '../assets/logosibbap.png'

const LogIn = () => {
  return (
    <div className="p-6">
          <img src={logo} alt='sibbap logo' className="w-48 h-auto" />
        <h1>Log In</h1>
    </div>
  )
}
export default LogIn
